import "./css/index.scss";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import Landing from "./pages/Landing/Landing";

function App() {
  return (
    <Router>
      <div className="w-full h-full">
        <Switch>
          <Route exact path="/" component={Landing}></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
